import React from 'react';

const Accordion = ({ question, answer }) => {
  // hamne {...curElem} pass kiya hai with object distructing.
  return (
    <>
      <div className="main-heading">
        <p>+</p>
        <h2>{question}</h2>
        <h2>{answer}</h2>
      </div>
    </>
  );
};

export default Accordion;
